  //const [loading] = useState<boolean>(true);

  // Create refs for both forms
  const createTeamFormRef = useRef<FormHandle>(null);
  const joinTeamFormRef = useRef<FormHandle>(null);

  const { value: token, clear: clearToken } = useLocalStorage<string>(
    "token",
    ""
  );
  const { value: userId } = useLocalStorage<string>("userId", "");

  const [activeUser, setActiveUser] = useState<User | null>(null);

  const handleLogout = async (): Promise<void> => {
    try {
      if (!activeUser) {
        const response = await apiService.get<User>(`/users/${userId}`, token, {
          headers: {
            Authorization: `Bearer ${token.replace(/^"(.*)"$/, "$1")}`,
          },
        });
        console.log("Fetched active user:", response);
        setActiveUser(response);
      }

      if (!activeUser?.username || !activeUser?.id) {
        throw new Error("User information is missing.");
      }

      const response = await fetch(`${getApiDomain()}/logoff`, {
        method: "PUT",
        headers: {
          "Content-Type": "application/json",
          Authorization: `Bearer ${token.replace(/^"(.*)"$/, "$1")}`,
        },
        body: JSON.stringify({
          username: activeUser.username,
          id: activeUser.id,
        }),
      });

      if (!response.ok) {
        throw new Error(`Logout failed: ${response.statusText}`);
      }

      // Successfully logged out
      console.log("Logged out successfully.");
      clearToken();
      localStorage.removeItem("user");
      router.push("/login");
    } catch (error) {
      alert(
        `Logout failed: ${
          error instanceof Error ? error.message : "Unknown error"
        }`
      );
    }
  };

